import { createApp } from 'vue'
import App from './App.vue'
import './index.css'
import anime from 'animejs/lib/anime.es.js';

createApp(App).mount('#app')

/* ANIMATIONS */

let title = anime.timeline({
    targets: '.text-title'
});
title.add({
    translateX: 0,
    rotate: 360,
    duration: 2000
})
